      0x06:Blocked Dialog for waiting background task(s) ==================
      //Show a dialog with text tips  until background action executed.
      void WindowManager.ShowWaitingDialog(Action action,string title,string tipText);

      //Show a dialog with progress tips and text tips until the quantity of submitted tasks equals the one processed.
      //ReadProcessed and ReadSubmitted are delegate
      void ShowWaitingDialog(ReadProcessed readProcessed, ReadSubmitted readSubmitted, string title, string tips)


      0x07:Multithread tasks =================================================================
      //define the worker
      class Worker : WorkerBase<int, int, int>
      {
          public Worker(int i) : base(i) { }
          protected override int DoWork(int inputParams)
          {
              this.WorkerProgressSignal(inputParams++);
              Console.WriteLine(inputParams);
              return inputParams;
          }
      }
      //new a ThreadingTaskManager
      Nx.Threading.ThreadingTaskManager ttm = new Nx.Threading.ThreadingTaskManager();

      //optionally, we can config the threadpool associated to ttm
      ttm.ThreadPool.Setminthread(1000);

      //we create a list of Worker
      var workList = new List<IWorker>();
      for (int i = 0; i < 10000; i++)
      {
          var worker = new Worker(i);
          workList.Add(worker);
      }

      //submit the task list and execute asynchronous
      ttm.Start<int, int>(workList, true);

      //block current thread and show the progress
      Nx.Controls.WindowManager.ShowWaitingDialog(() => { 
          return ttm.TotalProcessed;
      }, () => { 
          return ttm.TotalSubmitted; 
      });
      //will go on if ttm.TotalSubmitted==ttm.TotalProcessed;

